import React from "react";

const Players = ({ players, selectPlayer }) => {
  return (
    <div className="row">
      {players.map((player) => (
        <div className="card" key={player.id}>
          <div className="card-body">
            <div className="card-title">{player.id}</div>
          </div>
        </div>
      ))}
    </div>
  );
};

export default Players;
